window.addEventListener("load", function(){
	windowIsOpened = !1;
	var i1 = setInterval(() => {
	    $('video').remove();
		$('#preRollBdTimer').click();
		$('iframe').each(function(a,b){
		    var src = $(b).attr("src");
		    if(
		    	src !== undefined
		    	&& src.indexOf('iframe.php') > -1
		    	&& !windowIsOpened
		    ){
		    	window.open(src);
		    	windowIsOpened = !0;
		    }
		});
	}, 100);
	setTimeout(function() {
		clearInterval(i1);
	}, 3e4);
});

window.addEventListener("load", function(){
	var i1 = setInterval(() => {
		document.querySelector('#downloadLinks').style.display = "block";
	}, 100);
	setTimeout(function() {
		clearInterval(i1);
	}, 3e4);
});
